(50, 219, 'Trend Set - 9 a 11 hs - Gestión de contenidos para intranets, newsletters, house organs y carteleras', '2012-03-29', '09:00:00', 130, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', '', 'http://meeting.isalas.com.ar', '', 'es-ES', 'OBJETIVOS<br>\n<p>\n- Brindar técnicas para estructurar y organizar contenidos en medios impresos y digitales.<br>\n- Proveer criterios analíticos acerca del funcionamiento de los diferentes contenidos.<br>\n- Brindar recursos para transmitir mensajes y alcanzar los objetivos.<br>\n- Compartir casos de organizaciones que generan contenidos de valor.<br>\n</p>\nCONTENIDOS<br>\n<p>\n- Elaboración de contenidos para medios impresos y digitales.<br>\n- Definición de un Manual de Estilo.<br>\n- Los medios de comunicación interna como herramientas de gestión.<br>\n- Edición de contenidos.<br>\n- Niveles de lectura.<br>\n- Creatividad y persuasión de los mensajes.<br>\n- Herramientas de feedback.\n</p>', 869930, 0, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=BICnc24TY3Ta0KP%2bS2YmVg%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=ACzvY6f28as%3d', '2012-03-27 11:06:11', 'ok', NULL),
(51, 221, 'Trend Set - 11:30 a 13:30 - Nuevas Tendencias en Comunicación Interna', '2012-03-29', '11:30:00', 135, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', '', 'http://meeting.isalas.com.ar', '', 'es-ES', '<p>OBJETIVOS</p>\n<p>\n- Compartir estrategias y prácticas de comunicación interna que implementan las organizaciones modernas.<br>\n- Identificar modelos de experiencias de organizaciones que integran la comunicación interna como un elemento de la estrategia del negocio.<br>\n- Contribuir a posicionar la comunicación interna como un servicio esencial dentro de la compañía.\n</p>\n<p>CONTENIDOS</p>\n<p>\n- Planeamiento y medición de resultados.<br>\n- Canales tradicionales y canales digitales.<br>\n- Campañas de Comunicación Interna.<br>\n- Segmentación de públicos.<br>\n- Implementación de una Red de Referentes de Comunicación Interna.\n</p>', 869937, 0, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=C%2f3ihUwyWh07AI0e3llPcw%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=Jmo0HH4%2bKTk%3d', '2012-03-27 11:12:04', 'ok', NULL),
(52, 223, 'Trend Set - 14 a 16 hs - Estrategias de Comunicación Interna de las Compensaciones y Beneficios', '2012-03-29', '14:00:00', 135, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', '', 'http://meeting.isalas.com.ar', '', 'es-ES', '<p>OBJETIVOS</p>\n<p>\n- Brindar estrategias y herramientas para lograr una efectiva comunicación de las compensaciones y beneficios.<br>\n- Diseñar un plan de comunicación interna de las compensaciones y beneficios.\n</p>\n<p>CONTENIDOS</p>\n<p>\n- Percepción y valoración.<br>\n- Mensajes clave.<br>\n- Medios, acciones, herramientas y responsables de comunicar.<br>\n- De comunicaciones tácticas a debates estratégicos.\n</p>', 869948, 0, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=HcgSCetIxxz0q5y4TyCuxQ%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=nlLa1YXR1y4%3d', '2012-03-27 11:16:21', 'ok', NULL),
