(141, 474, 'CURSO SIM - KIT DESPACHANTE DE ADUANA -', '2013-06-15', '13:45:00', 300, 'America/Argentina/Buenos_Aires', 'isalas2@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>Temas a desarrollarse en el &quot;CURSO SIM - KIT DESPACHANTE DE ADUANA&quot;<br /><br />Ingreso al Sistema. Solapa Caratula. Solapa Ingresos Brutos. Solapa Item. Solapa Bultos. Solapa Certificado Pac/Origen. Solapa Presupuesto general. Oficializaci&oacute;n. Telecarga. Impresi&oacute;n. Consulta bultos. Consulta declaraciones oficializadas. Consulta Subcuenta.<br />Diferencias en campos duales entre Importaci&oacute;n y Exportaci&oacute;n a consumo.<br />Liquidaciones manuales de Destinaci&oacute;n de importaci&oacute;n y exportaci&oacute;n a consumo.<br /><br />* Se env&iacute;a por e-mail PDF con modelos de documentos para trabajar con la liquidaci&oacute;n.</p><p>Usted se podr&aacute; conectar desde las 13:45hs. En el caso de conectarse antes va a observar un reloj contador. A las 14:00hs comienza el curso.</p><p><br />CONDUCCI&Oacute;N:<br />Samanta Grisell Lanata<br />Despachante de Aduana<br />&nbsp;</p>', 1502074, 9, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=0R9xPgNhZpw0QD2Be0dJFg%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=0JoP4VlMAaM%3d', '2013-06-14 20:34:28', 'ok', NULL),
