(170, 606, 'Leyendo a Jung. Clase 3', '2013-07-30', '13:00:00', 20, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>Hoy avanzaremos hasta la p&aacute;gina 75.</p><p>&quot;Toda mi jueventud puede compendiarse bajo el concepto del secreto. A causa de ello me refugi&eacute; en una soledad casi insoportable y hoy veo aquello como una gran obra, y tambi&eacute;n como tal el que yo resistiera a la tentaci&oacute;n de hablar de ella con alguien. Se configur&oacute; ya entonces mir elaci&oacute;n con el mundo tal como hoy es: tambi&eacute;n hoy estoy solo porque ss&eacute; cosas y debo se&ntilde;alar que los dem&aacute;s no las saben y que, en su mayor&iacute;a, tampoco quieren en absoluto saberlas.&quot; 58-59</p>', 1580283, 13, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=IPhkZClLt8378mk3yT8gnA%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=a5LM3a5xaAY%3d', '2013-07-30 11:35:56', 'deleted', 611),
