(185, 729, 'Conferencia', '2013-08-10', '16:30:00', 180, 'America/Bogota', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>&quot;Constelaciones familiares&quot; en &quot;Un caf&eacute; con los arquetipos&quot;.<br /><br />En 1910 Jung escribi&oacute; un art&iacute;culo titulado &quot;La constelaci&oacute;n familiar&quot; donde explica las relaciones entre los complejos individuales y aquellos que se instauran dentro del v&iacute;nculo familiar, acu&ntilde;ando el t&eacute;rmino &quot;constelaci&oacute;n&quot; para referirse a la activaci&oacute;n de una actitud expectante a actuar de determinada manera con respecto a un contexto tambi&eacute;n determinado por los complejos. (Dicho texto aparecen en el tomo 2 de sus obras completas titulado &quot;Investigaciones experimentales&quot;). Sobre este tema volver&iacute;a en 1935 en las famosas conferencias Tavistock (Obras Completas volumen 18/I).<br /><br />A&ntilde;os despu&eacute;s el te&oacute;logo, antrop&oacute;logo y pedagogo alem&aacute;n Bert Hellinger cre&oacute; un procedimiento terap&eacute;utico al que denomin&oacute; &quot;Constelaciones familiares&quot;, que busca operar dentro del sistema familiar y de la psique individual mediante una interesante combinaci&oacute;n de t&eacute;cnicas.<br /><br />Tenemos el gusto de invitar a nuestros amigos y amigas a escuchar a una de las personas que m&aacute;s sabe del tema en nuestra ciudad, el psic&oacute;logo y te&oacute;logo Francisco Javier Carmona Romero, con quien tendremos el gusto de conversar en nuestro espacio sabatino quincenal, un espacio abierto a los eternos interrogantes y a las nuevas b&uacute;squedas de respuestas.<br />&nbsp;</p><p>&nbsp;</p>', 1603484, 13, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=vbBMWd6mhhCp5ab8mys9AA%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=gI%2bvwWefUtU%3d', '2013-08-09 22:37:17', 'ok', NULL),
(186, 730, 'OTRS', '2013-08-12', '15:00:00', 120, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>Estado de las pruebas OTRS.</p>', 1606552, 14, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=0pkRGj1Rj3Ys%2bei7TnFHXA%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=XthlWb1Z6OY%3d', '2013-08-12 14:05:25', 'ok', NULL),
