(188, 736, 'Leyendo a Jung pg. 75 a 105', '2013-08-13', '18:30:00', 180, 'America/Bogota', 'isalas2@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>&quot;Todas las alusiones&nbsp;a mi intimidad me resultaban penosas, pues cuanto<br />m&aacute;s le&iacute;a y m&aacute;s enterado estaba del ambiente ciudadano,<br />m&aacute;s crec&iacute;a en m&iacute; la impresi&oacute;n de que lo que conoc&iacute;a ahora<br />como realidad pertenec&iacute;a a otro orden de cosas distinto de<br />la imagen del mundo que se form&oacute; en m&iacute; en el campo,<br />entre los r&iacute;os y los bosques, entre los animales y los hombres,<br />en un peque&ntilde;o pueblo sobre el cual luc&iacute;a el sol, soplaba<br />viento y pasaban las nubes, y todo ello envuelto en<br />la oscura noche llena de cosas indefinibles. No era tan s&oacute;lo<br />un lugar en el mapa, sino el mundo de Dios, ordenado y<br />lleno de misterioso sentido. Esto parec&iacute;a que los hombres<br />lo ignoraban y ya los animales hab&iacute;an perdido en cierto<br />modo este sentido. Esto se ve&iacute;a en la mirada triste y<br />perdida en la lejan&iacute;a de las vacas, en los resignados ojos<br />de los caballos, en la sumisi&oacute;n del perro que se apegaba al<br />hombre y en el mismo comportamiento del gato que hab&iacute;a<br />convertido la casa y el granero en su vivienda y lugar de<br />caza. Del mismo modo que los animales, los hombres me<br />parec&iacute;an inconscientes; miraban al suelo o hacia los<br />&aacute;rboles para ver en qu&eacute; y para qu&eacute; se pod&iacute;an utilizar...&quot;</p>', 1608542, 13, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=J41deDESm4s7btyJdr5jGQ%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=FKXumx3H59k%3d', '2013-08-13 11:55:55', 'ok', NULL),
