(195, 833, 'otrsbr', '2013-08-16', '17:20:00', 120, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '', 1614142, 14, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=ckNi914ghW9aRFGlx4nD%2fg%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=iS2xwz1FRkk%3d', '2013-08-16 17:21:40', 'ok', NULL),
(196, 835, 'Curso de Gerenciador - Examen Final', '2013-08-20', '17:30:00', 300, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>17:30 - 18:00 - Apertura del aula para consultas y preparaci&oacute;n del examen</p><p>18:00 - 20:00 - Proceso examinatorio</p>', 1621692, 11, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=tJQHhcuKVV8toLet7tkpPw%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=xj09sNr9eeA%3d', '2013-08-20 09:20:29', 'ok', NULL),
(197, 846, 'Cuarta sesión (106-135)', '2013-09-10', '18:30:00', 180, 'America/Bogota', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>Retrospectivamente veo en qu&eacute; medida mi desarrollo<br />infantil anticipaba acontecimientos futuros y preparaba<br />modos de adaptaci&oacute;n a la ruptura religiosa de mi padre,<br />as&iacute; como para la tr&aacute;gica revelaci&oacute;n de la actual imagen del<br />mundo, que ciertamente tampoco ha surgido de ayer a hoy<br />sino que ha proyectado largo tiempo sus sombras. A pesar<br />de que somos hombres de nuestra propia vida personal<br />somos tambi&eacute;n, por otra parte, en gran medida, representantes,<br />v&iacute;ctimas y promotores de un esp&iacute;ritu colectivo,<br />cuya vida equivale a siglos. Podemos ciertamente<br />imaginar una vida a la medida de nuestros propios deseos<br />y no descubrir nunca que fuimos en suma comparsas del<br />teatro del mundo. Pero existen hechos que ciertamente ignoramos,<br />pero que influyen en nuestra vida y ello tanto<br />m&aacute;s cuanto m&aacute;s ignorados son.</p>', 1667072, 13, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=GDUL2oDeF%2fgqoolAgCmG4Q%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=tMVHfDC%2brDc%3d', '2013-09-10 03:06:19', 'ok', NULL),
(198, 848, 'Páginas 135-165', '2013-09-17', '18:30:00', 180, 'America/Bogota', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>En muchos casos psiqui&aacute;tricos el paciente tiene una<br />historia que no se relata y que por regla general nadie<br />conoce. Para m&iacute;, la verdadera terap&eacute;utica comienza s&oacute;lo<br />despu&eacute;s de la investigaci&oacute;n de dicha historia personal.<br />Constituye el secreto del paciente en el cual &eacute;ste se ha<br />destrozado. A la vez encierra la clave para su tratamiento.<br />El m&eacute;dico s&oacute;lo debe saber c&oacute;mo averiguarlo. Debe<br />plantear las preguntas que afectan a todo hombre y no<br />s&oacute;lo a sus s&iacute;ntomas. La exploraci&oacute;n de los datos<br />conscientes no basta en la mayor&iacute;a de los casos. Bajo<br />ciertas circunstancias el ensayo de asociaci&oacute;n puede abrir<br />la puerta, y tambi&eacute;n la interpretaci&oacute;n de los sue&ntilde;os* puede<br />lograrlo, o el prolongado y sufrido contacto humano con<br />el paciente.</p>', 1681449, 13, 'http://authorlive.com/aliveext/LoginToSession.aspx?SessionCode=zFIDscmNm5WfjmqXHeK%2b%2bg%3d%3d', 'http://authorlive.com/aliveext/Recorded.aspx?SessionCode=zHCVQr9HAz4%3d', '2013-09-16 23:25:52', 'ok', NULL),
(199, 850, 'Pg. 165-196', '2013-09-24', '18:30:00', 180, 'America/Bogota', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>&quot;Mis pacientes y analizados me han situado tan cerca de</p><p>la realidad de la vida humana que yo no hubiera podido</p><p>encontrar nada m&aacute;s esencial en mis experiencias. El</p><p>encuentro con hombres de los tipos m&aacute;s dispares y del m&aacute;s</p><p>diverso nivel psicol&oacute;gico fue para m&iacute; de una importancia</p><p>mucho mayor que una conversaci&oacute;n fragmentaria con una</p><p>eminencia. Las conversaciones de mi vida m&aacute;s bellas y ricas</p><p>en consecuencias son an&oacute;nimas.&quot;&nbsp; pg. 177</p>', 1693663, 13, 'http://live.wiziq.com/aliveext/LoginToSession.aspx?SessionCode=lHdw0hzDvyOHkFkPy6bIyQ%3d%3d', 'http://live.wiziq.com/aliveext/Recorded.aspx?SessionCode=23XtaNSSFyw%3d', '2013-09-23 16:12:57', 'ok', NULL),
(200, 853, '196-226', '2013-10-01', '18:30:00', 180, 'America/Bogota', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>En la medida en que lograba traducir mis emociones en</p><p>im&aacute;genes, es decir, hallar aquellas im&aacute;genes que se</p><p>ocultaban tras las emociones, sent&iacute;a tranquilidad interna. Si</p><p>me hubiera abandonado por completo a mis emociones, lo</p><p>m&aacute;s probable es que hubiera sido destrozado por las</p><p>actividades del inconsciente. Quiz&aacute;s los hubiera podido</p><p>separar, pero entonces habr&iacute;a ca&iacute;do irremisiblemente en una</p><p>neurosis y finalmente sus contenidos me hubieran destruido.</p><p>Mi experimento me afirm&oacute; en la convicci&oacute;n de lo valioso</p><p>que es, desde el punto de vista terap&eacute;utico, hacer conscientes</p><p>las im&aacute;genes que se hallan detr&aacute;s de las emociones.</p>', 1707446, 13, 'http://live.wiziq.com/aliveext/LoginToSession.aspx?SessionCode=YZagDg74%2b6zJ35VSRx81jw%3d%3d', 'http://live.wiziq.com/aliveext/Recorded.aspx?SessionCode=KaVwVZ9hEWw%3d', '2013-09-30 23:15:48', 'ok', NULL),
(201, 856, 'Programa de Gerenciador de Seguridad Privada - Clase 1', '2013-10-01', '16:00:00', 300, 'America/Argentina/Buenos_Aires', 'isalas2@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>16:30 - 17:00 - Apertura de la sala para pruebas de conectividad</p><p>17:00 - 20:15 - Desarrollo de la Clase 1</p>', 1708167, 11, 'http://live.wiziq.com/aliveext/LoginToSession.aspx?SessionCode=dZ2wyvn3niuK2D0dByZxlw%3d%3d', 'http://live.wiziq.com/aliveext/Recorded.aspx?SessionCode=CX9LEfdIu20%3d', '2013-10-01 07:57:05', 'ok', NULL),
(202, 860, 'Programa de Gerenciador de Seguridad Privada - Clase 2', '2013-10-03', '16:00:00', 300, 'America/Argentina/Buenos_Aires', 'isalas@eytech.com.ar', 0, '', 'video', 50, '', 'true', 'http://meeting.isalas.com.ar/room/logout', '', 'es-ES', '<p>16:30 - 17:00 - Pruebas de conectividad y consultas sobre la clase anterior</p><p>17:00 - 20:15 - Desarrollo de la Clase 2</p>', 1712614, 11, 'http://live.wiziq.com/aliveext/LoginToSession.aspx?SessionCode=eBR%2b8uRFHWT6yZIxwQhceQ%3d%3d', 'http://live.wiziq.com/aliveext/Recorded.aspx?SessionCode=ripOa410Xjo%3d', '2013-10-03 10:03:04', 'ok', NULL);
